import React from 'react';
import './RandomVideo.css';

import YouTubeVideo from '../YouTubeVideo/YouTubeVideo';

class RandomVideo extends React.Component {
  render() {
    return (
    	<div className="random_video">
    		<h1 className="random_title">Random Video</h1>
    		<YouTubeVideo link={this.props.randomVideo.link} id={this.props.randomVideo.id} title={this.props.randomVideo.title} />
    	</div>
    );
  }
}

export default RandomVideo;
